/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `tg_incomp_emp` BEFORE INSERT ON `emp_cargo` FOR EACH ROW BEGIN
    -- Declaracin de variables
    DECLARE hs_actuales INT DEFAULT 0;
    DECLARE hs_nuevas INT DEFAULT 0;
    DECLARE msg VARCHAR(255) DEFAULT "El agente, con esta designacin, supera el lmite de Horas Permitidas";

    -- Obtiene las horas actuales del empleado desde la vista
    SELECT vw.total_hs INTO hs_actuales
    FROM liqui_escuela.vw_horasxemp AS vw
    WHERE vw.id_empleado = NEW.id_empleado;

    -- Obtiene las horas del nuevo cargo al que se designar el empleado
    SELECT c.horas INTO hs_nuevas
    FROM cargo AS c
    WHERE c.id_cargo = NEW.id_cargo;

    -- Verifica si el total de horas supera el lmite permitido
    -- si supera el lmite, no frena la designacin y lanza mensaje de error
    IF hs_actuales + hs_nuevas > 50 THEN
        SIGNAL SQLSTATE '45000' 
        SET MESSAGE_TEXT = msg;
    END IF;
END */;;
DELIMITER ;
