/*!50003 SET collation_connection  = latin1_swedish_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ingesta_presentismo`(IN dia_asistencia DATE)
BEGIN
-- BORRA UN REGISTRO DE DA ANTERIOR - PARA QUE NO HAYAN DUPLICADOS EN LA TABLA ASISTENCIA
-- LA CONFIGURACIN PREDETERMINADA DE MY SQL NO PERMITE BORRAR DATOS DE UNA TABLA RELACIONADA, POR ESTE MOTIVO
-- SE MODIFICA EL SETEO DEL SQL_SAFE_UPDATES. LUEGO DEL DELETE SE VUELVE A ACTIVAR, POR SEGURIDAD.
	SET SQL_SAFE_UPDATES = 0;
    DELETE FROM liqui_escuela.asistencia
        WHERE fecha = dia_asistencia;
	SET SQL_SAFE_UPDATES = 1;
-- INSERCIN EN TABLA ASISTENCIA
    INSERT INTO liqui_escuela.asistencia(
        fecha, id_empleado, asistencia
    ) SELECT
        dia_asistencia,
        e.id_empleado,
        -- SE UTILIZA LA FUNCIN COALESCE PARA EVITAR TENER NULOS - DEVUELVE "PRESENTE" COMO VALOR PREDETERMINADO
        COALESCE(au.asistencia, 'PRESENTE') AS asistencia
        FROM liqui_escuela.empleado AS e
		LEFT JOIN 
        (SELECT empleado_id
		,		asistencia
        FROM liqui_escuela.ausentismo 
			WHERE fecha = dia_asistencia) AS au
